CREATE DATABASE computer_department;
USE computer_department;

-- Create the students table
CREATE TABLE students (
    id VARCHAR(11) PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    course VARCHAR(100) NOT NULL,
    year_section VARCHAR(3) NOT NULL,
    sex VARCHAR(6) NOT NULL,
    bdate DATE NOT NULL,
    address VARCHAR(100) NOT NULL,
    email VARCHAR(50) NOT NULL,
    phoneNum VARCHAR(15) NOT NULL,
    fatherName VARCHAR(100) NOT NULL,
    motherName VARCHAR(100) NOT NULL
);

-- Create the course table
CREATE TABLE course (
    id INT AUTO_INCREMENT PRIMARY KEY,
    studid VARCHAR(11) NOT NULL,
    acadyear VARCHAR(9),
    semester VARCHAR(20),
    course1 VARCHAR(100),
    course2 VARCHAR(100),
    course3 VARCHAR(100),
    course4 VARCHAR(100),
    course5 VARCHAR(100),
    CONSTRAINT fk_student_id FOREIGN KEY (studid) REFERENCES students(id) ON DELETE CASCADE,
    CONSTRAINT unique_course_record UNIQUE (studid, acadyear, semester)
);

-- Create the grades table
CREATE TABLE grades (
    studid VARCHAR(11) NOT NULL,
    course_name VARCHAR(100) NOT NULL,
    acadyear VARCHAR(9) NOT NULL,
    semester VARCHAR(10) NOT NULL,
    grade CHAR(10) NOT NULL,
    units INT NOT NULL,
    CONSTRAINT fk_grades_student_id FOREIGN KEY (studid) REFERENCES students(id) ON DELETE CASCADE,
    CONSTRAINT pk_grades PRIMARY KEY (studid, course_name, acadyear, semester)
);

-- Create the gwa table
CREATE TABLE gwa (
    studid VARCHAR(11) NOT NULL,
    acadyear VARCHAR(9) NOT NULL,
    semester VARCHAR(20) NOT NULL,
    gwa DECIMAL(4,2) NOT NULL,
    CONSTRAINT fk_gwa_student_id FOREIGN KEY (studid) REFERENCES students(id) ON DELETE CASCADE,
    CONSTRAINT pk_gwa PRIMARY KEY (studid, acadyear, semester)
);
ALTER TABLE course MODIFY semester VARCHAR(50);
ALTER TABLE grades MODIFY semester VARCHAR(50);
ALTER TABLE gwa MODIFY semester VARCHAR(50);
ALTER TABLE course MODIFY acadyear VARCHAR(20);

CREATE TABLE course_status (
    id INT AUTO_INCREMENT PRIMARY KEY,
    studid VARCHAR(11),
    acadyear VARCHAR(9),
    semester VARCHAR(20),
    course_name VARCHAR(100),
    status VARCHAR(20) DEFAULT 'Enrolled', -- or 'Dropped'
    FOREIGN KEY (studid) REFERENCES students(id) ON DELETE CASCADE
);



